import React  ,{Component}from 'react';
import './CheifHomePage.css';
import Cards from '../Card/Card.js'
import facebook from '../facebook.svg';
import instagram from '../instagram.svg'
import twitter from '../twitter.svg';
import back from '../gray.png';
import chef from '../chef.svg';
import more from '../more.svg';
import logout from '../logout .svg';
import * as firebase from 'firebase';
import saved from '../saved1.svg'
import search from '../search.svg'
import salad from '../salad.svg';
import desert from '../sweet.svg';
import drinks from '../drinks.svg';
import vagen from '../vagen.svg';
import breakfast from '../breakfast.svg.svg';
import lunch from '../lunch.svg';
import diner from '../breakfast.svg';


  class Cheif extends Component{

    state={
      searchText:""
    }
    logout=()=>{
      firebase.auth().signOut().then(function() {
        // Sign-out successful.
      }).catch(function(error) {
        // An error happened.
      });
    }

    eattimeMeals=(name)=>{
      console.log(name);
      this.props.history.push('/eatTime', {id: name})

    }

    occasion=(name)=>{
      console.log(name);
      this.props.history.push('/occasion', {id: name})

    }

    type=(name)=>{
      console.log(name);
      this.props.history.push('/type', {id: name})

    }

    vegan=()=>{
      this.props.history.push('/vegan')

    }

    search=(e)=>{
      this.setState({searchText:e.target.value})      
    }
    ClickSearch=()=>{
      this.props.history.push('/result', {id: this.state.searchText})

    }
    render(){

      console.log(this.props)
    return (
      <div className='contaner'>
        <img 
          src={back} 
          style={{width:1366, height:60 }}
        />
          
          <img 
          className="savedChef" 
          src={saved}
          onClick={()=>this.props.history.push('/favourite')}
        />
          <div style={{flexDirection:"row"}}>
          <button className='searchButton' onClick={this.ClickSearch}>
            <img style={{width:20,height:20}} src={search}/>
          </button>
          <input className='search' type="text" name="search" placeholder="Search for an ingerdient" onChange={this.search}/>
          <img 
            src={chef}
            className='user'
          />

          <img
          className='logout'
          src={logout}
          onClick={()=>this.logout()}
          />

          <a href="https://www.facebook.com/basmakuhail2003">
            <img 
              src={facebook}
              className='facebookUser'/> 
          </a>

          <a href="https://www.facebook.com/basmakuhail2003">
            <img 
              src={instagram}
              className='instagramUser'/>
          </a>

          <a href="https://www.facebook.com/basmakuhail2003">
            <img 
              src={twitter}
              className='twitterHome'/>               
          </a>

          <div className='filterUser'>
            <button className='FilterBreak'  onClick={()=>this.eattimeMeals("breakfast")}> <img className='imgFilter' src={breakfast}/></button>
            <button className='FilterLunch'   onClick={()=>this.eattimeMeals("lunch")}> <img className='imgFilter' src={lunch}/></button>
            <button className='FilterDiner'  onClick={()=>this.eattimeMeals("dinner")}><img className='imgFilter' src={diner}/></button>
            <button className='occasionsFilter'  onClick={()=>this.occasion("")}><img className='imgFilter' src={"data:image/png;base64,"}/></button>       
            <button className='occasionsFilter'  ><img className='imgFilter' src={"data:image/jpeg;base64,"}/></button>       
            <button className='occasionsFilter'  ><img className='imgFilter' src={"https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSy0dc4ieHlUGBqDgL5gCQ6KmXUNOc86Vu1SkhW7wCEq8EuYa2F&usqp=CAU"}/></button>       
            <button className='occasionsFilter'  ><img className='imgFilter' src={"data:image/jpeg;base64,"}/></button>       
            <button className='buttonFilter'  onClick={()=>this.type("Drinks")}><img className='imgFilter' src={drinks}/></button>       
            <button className='buttonFilter' onClick={()=>this.type("Deserts")} ><img className='imgFilter' src={desert}/></button>       
            <button className='buttonFilter' onClick={()=>this.type("Sandwiches")}> <img className='imgFilter' src={"data:image/jpeg;base64,"}/></button>
            <button className='buttonFilter' onClick={()=>this.type("Soup")} ><img className='imgFilter' src={"https://images.pexels.com/photos/3662104/pexels-photo-3662104.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"}/></button>       
            <button className='buttonFilter' onClick={()=>this.type("Sea food")} ><img className='imgFilter' src={"https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTI7ehFBl79Yj66hUT0TAq9nJz6z8f94_6V7_YYC1peAhlZw8sa&usqp=CAU"}/></button>       
            <button className='buttonFilter' onClick={()=>this.type("Main meals")}><img className='imgFilter' src={"data:image/jpeg;base64,"}/></button>       
            <button className='buttonFilter' onClick={()=>this.type("Salads")}> <img className='imgFilter' src={salad}/></button>
            <button className='vegan' onClick={()=>this.vegan()} ><img className='imgFilter' src={vagen}/></button>       

          </div>
       

            <button 
              className="buttonMyMeals" 
              onClick={()=>this.props.history.push('/myMeals')}>
                My Meals
            </button>
          </div>
       

          <div className='cards'>
            <Cards {...this.props}/>
            <button 
              className="buttonAdd" 
              onClick={()=>this.props.history.push('/addmeal')}>
                <img  className='more' src={more}/>
            </button>
          </div>
      </div>
       
  );
    }
}

export default Cheif;